import API from '../API';
import { useEffect, useState } from 'react';
import { Button, Spacer, CallFilled } from '@aircall/tractor';

import AppStyling from '../AppStyling';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(AppStyling);

const CallList = ({ token, page }) => {
  const classes = useStyles();
  const [calls, setCalls] = useState([]);

  useEffect(() => {
    API.getCalls(token, page)
      .then(resp => resp.json())
      .then(data => setCalls(data.nodes));
  }, [token]);

  return (
    <div>
      <Spacer
        className={classes.callListContainer}
        space="s"
        width="700px !important"
        direction="vertical"
      >
        {displayCalls(calls)}
      </Spacer>
    </div>
  );
};

const displayCalls = calls => {
  console.log(calls);
  if (calls != undefined && calls.length > 1) {
    return calls.map(call => {
      return (
        <Button>
          <CallFilled />
          {console.log('hello')}
          {call.from}
        </Button>
      );
    });
  }
};

export default CallList;
